public class Solution {
    public void solve(char[][] board) {
        if(board == null)   return;
        
        int R = board.length;
        if(R == 0)          return;
        
        int C = board[0].length;
        if(C == 0)          return;
        
        int[][] memos = new int[R][C]; // 0 for unvisited, 1 for unsurrounded O
        
        for(int r = 0; r < R; r++) {
            int c = 0;
            // 0th column
            if(board[r][c] == 'O' && memos[r][c] == 0) {
                dfs(board, memos, r, c);
            }
            // last column
            c = C-1;
            if(board[r][c] == 'O' && memos[r][c] == 0) {
                dfs(board, memos, r, c);
            }
        }
        for(int c = 1; c < C-1; c++) {
            // 0th row
            int r = 0;
            if(board[r][c] == 'O' && memos[r][c] == 0) {
                dfs(board, memos, r, c);
            }
            // last column
            r = R-1;
            if(board[r][c] == 'O' && memos[r][c] == 0) {
                dfs(board, memos, r, c);
            }
        }
        
        for(int r = 1; r < R-1; r++) {
            for(int c = 1; c < C-1; c++) {
                if(board[r][c] == 'O' && memos[r][c] == 0) {
                    board[r][c] = 'X';
                }
            }
        }
    }
    
    private void dfs(char[][] board, int[][] memos, int r, int c) {
        if(board[r][c] == 'O' && memos[r][c] == 0) {
            memos[r][c] = 1;
        } else {
            return;
        }
        
        // up
        if(r > 0) {
            dfs(board, memos, r-1, c);
        }
        // down
        if(r < board.length - 1) {
            dfs(board, memos, r+1, c);
        }
        // left
        if(c > 0) {
            dfs(board, memos, r, c-1);
        }
        // right
        if(c < board[0].length - 1) {
            dfs(board, memos, r, c+1);
        } 
    }
}

